import React from "react";

function reverse(str) {
  let reversed = "";
  var reversed_list = []
  for (let i = str.length - 1; i >= 0; i--){
    reversed += str[i];
    reversed_list.push(str[i]);
  }
  return reversed;
}

const Bubble = (props) => {
  return(
    <div></div>
  );
}

export default Bubble;
